import { mount } from "cypress/react18";
import App from "../../src/App";
import "./../../src/dist/output.css";

Cypress.Commands.add("mount", mount);

describe("App.cy.js", () => {
    function darkOrLight(
        elementToBeDark,
        elementClassName,
        elementToBeLight,
        elementToBeLightClassName
    ) {
        cy.get(document.documentElement).then((elem) => {
            if (elem.hasClass("dark")) {
                elementToBeDark.should("have.class", elementClassName);
            } else {
                elementToBeLight.should(
                    "have.class",
                    elementToBeLightClassName
                );
            }
        });
    }

    it("desctop playground light", () => {
        cy.mount(<App />);
        cy.viewport(1200, 620);

        darkOrLight(
            cy.get("[id='fullAp']"),
            "md:dark:bg-[#212121]",
            cy.get("[id='fullAp']"),
            "md:bg-[#eaeaea]"
        );
    });

    it("desctop playground Dark", () => {
        cy.mount(<App />);
        cy.viewport(1200, 620);
        cy.get("[id='dark']").click().wait(1000);

        darkOrLight(
            cy.get("[id='fullAp']"),
            "md:dark:bg-[#212121]",
            cy.get("[id='fullAp']"),
            "md:bg-[#eaeaea]"
        );
        cy.get("[id='dark']").click().wait(1000);
    });

    /*it("profile image light"),
        () => {
            cy.mount(<App />);
            cy.viewport(1200, 620);

            cy.get(document.documentElement).then((elem) => {
                if (elem.hasClass("dark")) {
                    cy.get("[id='profileID']").should(
                        "have.attr",
                        "src",
                        "/static/media/profileDark.9087000b177d9b4a6676.jpg"
                    );
                } else {
                    cy.get("[id='profileID']").should(
                        "have.attr",
                        "src",
                        "/static/media/profileLight.71af9dc59f279b4fe9c7.jpg"
                    );
                }
            });
        };*/

    it("desctop text Dark", () => {
        cy.mount(<App />);
        cy.viewport(1200, 620);
        cy.get("[id='dark']").click().wait(1000);

        darkOrLight(
            cy.get("[id='fullApp']"),
            "md:dark:text-white",
            cy.get("[id='fullApp']"),
            "text-zinc-800"
        );
    });

    it("desctop text light", () => {
        cy.mount(<App />);
        cy.viewport(1200, 620);
        cy.get("[id='dark']").click().wait(1000);

        darkOrLight(
            cy.get("[id='fullApp']"),
            "md:dark:text-white",
            cy.get("[id='fullApp']"),
            "text-zinc-800"
        );
    });
});
